<html>
<head>
<meta http-equiv="Content-Type" content="text/html; charset=UTF-8">
<link rel="stylesheet" href="css/vars.css" />
</head>
<body>
	<h1>App_Timeline</h1>
	<fieldset><legend>notFound</legend></fieldset>

	<fieldset class="veil"><legend class="veil">nextPage:veil</legend>
		<var>nextPage</var>
	</fieldset>

	<fieldset class="loop">
		<legend class="loop">feed:loop
			<var><a href="date.html">date</a></var>
		</legend>
		
		<fieldset class="veil"><legend class="veil">feed:veil</legend>
			<var>text</var>
			<var>path</var>
			<var>tinyPath</var>
			<var>largePath</var>
			<var>squarePath</var>
			<var>x</var>
			<var>y</var>
			<var>tinyX</var>
			<var>tinyY</var>
			<var>largeX</var>
			<var>largeY</var>
			<var>squareX</var>
			<var>squareY</var>
		</fieldset>
		
		<fieldset class="veil"><legend class="veil">userField:veil</legend>
			<fieldset><legend>userField<var>userField</var></legend>
				<var>name</var>
				<var>icon</var>
				<var>code</var>
				<var>status</var>
				<var>mail</var>
				<var>mail_mobile</var>
				<var>user_url</var>
			</fieldset>
		</fieldset>
		
	</fieldset>
</body>
</html>
